import {BrowserRouter as Router,Route} from 'react-router-dom';


import GenerateSch from '../GenerateSchedulePage/GenerateSchedulePage';
const Button = () => {
    return (
        <Route render={({ history}) => (
            <button
              type='button'
              //onClick={() => { history.push('/new-location]') }}
              onClick={() => { history.push(<GenerateSch />) }}
            >
              START
            </button>
          )} />
    );
};

export default Button;
